import Search from '../src/container/Search.jsx'
import Rating from '../src/container/Rating.jsx'
function Main() {
    return (
      <BrowserRouter>
      <Routes>
        <Route path="/" >
          <Route path="*" element={<Search />}></Route>
          <Route path="rating" element={<Rating />}></Route>
          
        </Route>
      </Routes>
      </BrowserRouter>
    );
  }
export default Main;
